import React, { useEffect, useState } from 'react';
import ProfileCard from './components/ProfileCard';

function App() {
  const [profileData, setProfileData] = useState(null);

  useEffect(() => {
    // Simulación de la obtención de datos del backend
    const fetchData = async () => {
      // Simulación de una llamada a una API que devuelve un BLOB
      const response = await fetch('url-de-tu-api-que-devuelve-un-blob');
      const blob = await response.blob();

      // Datos simulados del perfil
      const data = {
        nombre: 'Juan',
        apellidos: 'Pérez',
        edad: 30,
        descripcion: 'Frontend Developer apasionado por React',
        fotoBlob: blob
      };

      setProfileData(data);
    };

    fetchData();
  }, []);

  if (!profileData) {
    return <div>Cargando perfil...</div>;
  }

  return (
    <div className="App">
      <ProfileCard
        nombre={profileData.nombre}
        apellidos={profileData.apellidos}
        edad={profileData.edad}
        descripcion={profileData.descripcion}
        fotoBlob={profileData.fotoBlob}
      />
    </div>
  );
}

export default App;
